  Page Header
  The header is a quick guide to where the Descendants on each page of the book are located within the family.
  • It traces the direct line of descent from the earliest couple in the book down to the first person listed on this page.
  In the example above, Brian Thomas Alan Anderson is the son of Lily Margaret Thompson who is the daughter of
  George Thomas Thompson who is the son of Harold James Thompson.
  Name Line
  The first name on the line is the registered (Birth Certificate) name of the Descendant.
  . The number preceding the Descendant's name indicates his birth order (Brian is the 4th child of Lily and Frederick)
  If the Descendant is married or has a partner, the second name is that of the Spouse (Patricia Colleen Fay Crawford
  is Brian's wife. Crawford was her surname prior to her marriage to Brian).
  . If there is no formal marriage, the terms 'and' or 'de facto' are used in place of a marriage date.
  If a Descendant has had more than one marriage (or partner), the Spouse's name is preceded by a (1), (2) etc (e.g.
  Gary McRae is the first of two spouses of Sheryl Anderson)
  - Where a person is known by a name other than their first Christian name, the known-as name is underlined (e.g.
  Colleen instead of Patricia). Nicknames are enclosed in brackets (e.g. Butch instead of Gary)
  Date Line
  e Dates are expressed in English format i.e. dd.mm yyyy.
  An unknown date is denoted by stars (e.g. ** ** **** - see Gary McRae's birth date)
  • The abbreviations, b, d and m preceding dates denote born, died and married.
  Text
  • The abbreviations b., m., d, and bd. within the text always precede the places of birth, marriage, death and burial.
  • The terms 'd/%' and 's/o' are short for 'daughter of and 'son of and always precede the names of the parent or
  parents of the Spouse.
  The Spouse's parents are listed with the father's name first followed by the mother's name. The mother is usually
  listed by her maiden name as is customary in genealogical records.
  The address is that of the Couple (or if separated, the Descendant) at the time of publication.
  * The biographical notes are as supplied by the Descendant or near relative(s). They are edited for style, spelling and
  grammatical form but not content.
  Indentations
  The vertical lines at the left side of the page indicate generation levels. In the above example, Gerald and Sheryl are
  both children of Brian and Colleen.
  The numbers 1 thru 9 at the foot of each page are intended to assist the tracing of generation levels through
  successive pages.
